description:
LAST EPISODE !
==============


&quot;Who will be left behind?&quot;


Jeffrey Reiner, Josh Pate                                  February 6, 2006


With a tsunami approaching the coast, the residents of Wilmington find themselves under a mandatory evacuation. Rich is trapped in the lab after mysteriously finding a picture of the missing Jackson on a computer, but Laura arrives and manages to rescue him. At the same time, Caitlin is knocked out trying to reach Miles and doesn't make it to the ferry in time, so Miles goes after her. He finds her and they race for safety in his parents' car and encounter Laura and Rich on the way. The four head for an open drawbridge, but the car runs out of gas and the tsunami is quickly approaching so they quickly dash into a church and to the roof of the steeple as the tsunami hits and the creatures invade the church. There, the group is reunited with Nimrod and look out upon the completely flooded town, causing Laura to comment that &quot;it is
a new world.&quot;
